import{getCookie}from"../cookies.min.js";const fetchCreateCard=t=>fetch("https://ajax.test-danit.com/api/v2/cards",{method:"POST",headers:{"Content-Type":"application/json",Authorization:"Bearer "+getCookie("token")},body:JSON.stringify({visit:t.visit,about:t.about,urgency:t.urgency,name:t.name,pressure:t.pressure,massIndex:t.massIndex,diseases:t.diseases,age:t.age,lastDate:t.lastDate,specialist:t.specialist,specialistEng:t.specialistEng,clientAge:t.clientAge})}).then(e=>e.json()).then(e=>{t.id=e.id});export{fetchCreateCard};